import React from "react";
import "./styles.css";
import { Typography } from "@mui/material";


class Info extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: props.name,
        }
    }    

    render() {
        return (
            <Typography>
                Hi
            </Typography>
        )
    }
}

export default InfoPage;
